(2, '210001', 'Kolim ENT', 'gmfaruk2021@gmail.com', '01123456789', '8801123456789', NULL, '23432', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 140, 141, 142, 143, '2021-11-29 04:55:40', '2022-12-31 06:31:37', '<p>1. The Supply has to be completed within 03 Days fiotn the date of issuance of purchase order.</p>\r\n\r\n<p>The Supply must be done as per the direction of the consultant who has been appointed by MBM authority.</p>\r\n\r\n<p>2. Any kind of faulty or defects in materials shall not be acceptable for delivery. The supply has to be made as per requirement and approved sample. If found any deviation from the requirement and approved sample, JAB Authority will take back all materials at their own cost.</p>\r\n\r\n<p>3. Factory Contact Details: For IYl BM &amp; Nl BAGI-2: Engr. Julkar Nayen Khan, Cell: 01725929392/ Engr. IYIr. J ahangir Alam, Cell: 01790979530. lf you need further clarification about anything please contact Qtr. Kamal Hossein, Project 4Ianagement Department, and Cell: 01673757108 and Any Financial &rsquo;Payment related issue please communicate with lIr. Amir Khusru, Cell: 01775552377 &amp; 01756735025.</p>\r\n\r\n<p>5. JAB authority has to attach the delivery challan (Having seal-sign of concerned person/department) and a photocopy of purchase order with the final Unit-Wise bill.</p>\r\n\r\n<p>G.The Payment should be made as per actual measrtrement and quantity which will be checked by the MBM Authority. Based on their measurement and quantity, the bill will be proceeded for final payment. If any materials will be in hand at site after the completion of RO Based WTP installiition work, JAB authority will take back these materials within 2 days from the date of notifying to JAB authority from MBM authority. Materials that are returned to JAB authority will be deducted from the final bill as cliscussed both parties.</p>\r\n\r\n<p>7. VAT &amp; TAX is excluded in the mention price.</p>\r\n\r\n<p>8.100% Payment will be made after 30 days from the date of successful delivery.</p>\r\n\r\n<p>9. MBM Authority has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</p>\r\n\r\n<p>&nbsp;</p>', 'yes', 'Active', 'sent-to-purchase', 72, 1, NULL),
