(13, '220008', 'NBR Circle 10', 'NBRCircle10@nbr.gov.bd', '01234567890', '01234567890', 'NBR Circle 10', 'NBR Circle 10', 'NBR Circle 10', 'NBR Circle 10', 'NBR Circle 10', 'NBR Circle 10', 'NBR Circle 10', 'upload/supplier-owner-photo/2022/09/18/894180922031705.png', NULL, '01234567890', NULL, 196, 0, 0, 0, '2022-12-25 09:23:53', '2022-12-31 06:31:37', NULL, 'yes', 'Active', 'management-approved', 72, 1, NULL),
(15, '220010', 'Sumon Trade Corporation', 'sumontradecorporation@gmail.com', NULL, '+8801711222014', NULL, 'TRAD/DSCC/250322/2019', NULL, NULL, NULL, 'Shaikh Nurul Amin Sumon', '1487096164', NULL, NULL, '+8801312906212', NULL, 0, 0, 0, 0, '2022-09-07 02:14:34', '2022-12-31 06:31:37', '<ol>\r\n	<li>The Supply has to be completed within September 06, 2022.</li>\r\n	<li>The Supply has to be made as per Specific Size. If any deviation (for example, damaged during transportation time) found with the materials, the STC Authority will return all Accessories at their own cost.</li>\r\n	<li>STC authority has to attach the Delivery Challan <strong>(Having seal-sign of concerned person/department) </strong>and photocopy of purchase order with the final <strong>Unit-Wise&nbsp;</strong>bill.</li>\r\n	<li>VAT &amp; TAX is excluded in the mentioned price.</li>\r\n	<li>CEIL Authority has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>', 'yes', 'Inactive', 'purchase-declined', 1, 1, NULL),
(16, '220011', 'Samir Boiler House', 'mir.dinislam321@gmail.com', NULL, '01305239281', '816257892259', 'TRAD/DSCC/018970/2021', NULL, NULL, NULL, 'Md. Din Islam', '3717590321', NULL, NULL, '+8801305239281', NULL, 0, 0, 0, 0, '2022-09-07 03:07:07', '2022-12-31 06:31:37', '<ol>\r\n	<li>The supply has to be made as per approved sample and technical specification.&nbsp; If any deviation (mismatch of technical specs and damaged during transportation time) found with the supplied products, the seller will return all deviated products at their own cost.</li><li>VAT and TDS is included in the mentioned total price as per govt. rules.&nbsp;</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>The seller has to attach the Delivery Challan&nbsp;<span style=\"font-weight: bolder;\">(Having seal-sign of concerned person/department)&nbsp;</span>and photocopy of purchase order with the final&nbsp;<span style=\"font-weight: bolder;\">Unit-Wise</span>&nbsp;bill.&nbsp;</li><li>The purchaser has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li></ol>', 'yes', 'Active', 'management-approved', 1, 1, NULL),
(18, '220013', 'Nimo Lighting', 'nimolighting@gmail.com', NULL, '01316316893', '141764387172', 'TRAD/DSCC/352670/2019', '002777059-0301', '002777059-0301', 'www.nimolightingbd.com', 'Habibur Rahman', '9145045580', 'upload/supplier-owner-photo/2022/09/17/446170922082406.jpg', NULL, NULL, NULL, 0, 0, 0, 0, '2022-09-18 03:24:06', '2023-01-03 05:50:51', '<ol style=\"margin-bottom: 0px;\"><li>The products must be supplied as per approved previous sample and specification. If the products do not match with the approved sample and specification, then the products will be returned by the seller at their own cost.&nbsp;</li><li>All Components of products (Lights) should have to be under two (2) years replacement warranty (if it is repairable, then it will be repaired by the seller) from the date of successful delivery.&nbsp;</li><li>VAT and TDS is included in the mentioned total price as per govt. rules.&nbsp;</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>The Original Delivery Challan (having seal-sign of concerned person/department) has to submit along with&nbsp;Warranty Card and a photocopy of purchase order with the final Unit-Wise Bill.&nbsp;</li><li>The purchaser has the right to cancel purchase order or any part of it, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.&nbsp;&nbsp;</li></ol>', 'yes', 'Active', 'management-approved', 5, 5, NULL),
(19, '220014', 'Seven Circle (Bangladesh) Ltd.', 'khorshed.msd@sevencircle-bd.com', '58817690-3', '+8801766664936', '869413248102', '00176', '000000503-0306', NULL, 'www.sevenringscement.com', 'Mohammad Ali Pasha', '5950608843', 'upload/supplier-owner-photo/2022/09/17/893170922083006.jpg', NULL, NULL, NULL, 0, 0, 0, 0, '2022-09-18 03:30:06', '2023-01-03 06:20:59', '<ol>\r\n	<li>Any package damaged and/or date expired products shall not be acceptable for the delivery. The seller shall return all damaged and/or date expired products at their own cost.&nbsp;</li><li>VAT and TDS is included in the mentioned total price as per the govt. rules.&nbsp;</li>\r\n	<li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li>\r\n	<li>The seller has to attach the Original Delivery Challan (having seal-sign of concerned person/department) with the final bill.</li>\r\n	<li>The purchaser&nbsp;has the right to cancel purchase order or any part of, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 7, NULL),
