Photocopy of work order along with the Unit wise bill.&nbsp;</li>\r\n	<li>Payment should be made as per actual Quantity which will be determined by the engineers engaged by the purchaser.&nbsp;&nbsp;</li>\r\n	<li>The purchaser has the right to cancel work order or any part of it, if the vendor fails to abide by the terms and conditions of the work order at any time or if the situation demands so.&nbsp;</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>', 'yes', 'Active', 'management-approved', 5, 1, NULL),
