(37, '220031', 'Sumon Trade Corporation', 'sumontradecorporation@gmail.com', '01711222014', '01911112650', '193292716958', 'TRAD/DSCC/250322/2019', '003285314-0205', '003285314-0205', NULL, 'Shaikh Nurul Amin Sumon', '1487096164', NULL, NULL, '01711222014', NULL, 0, 0, 0, 0, '2022-11-14 23:24:59', '2022-12-31 06:31:37', '<ol>\r\n	<li>The supply has to be made as per approved sample and technical specification.&nbsp; If any deviation (mismatch of technical specs and damaged during transportation time) found with the supplied products, the seller will return all deviated products at their own cost.</li><li>VAT and TDS is included in the mentioned total price.</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>The seller has to attach the Delivery Challan&nbsp;<span style=\"font-weight: bolder;\">(Having seal-sign of concerned person/department)&nbsp;</span>and photocopy of purchase order with the final&nbsp;<span style=\"font-weight: bolder;\">Unit-Wise</span>&nbsp;bill.&nbsp;</li><li>The purchaser has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 1, NULL);
INSERT INTO `suppliers` (`id`, `code`, `name`, `email`, `phone`, `mobile_no`, `tin`, `trade`, `bin`, `vat`, `website`, `owner_name`, `owner_nid`, `owner_photo`, `owner_email`, `owner_contact_no`, `auth_person_letter`, `payable_account_id`, `payable_purchase_id`, `payable_discount_id`, `advance_account_id`, `created_at`, `updated_at`, `term_condition`, `deletable`, `status`, `approved_by`, `created_by`, `updated_by`, `deleted_at`) VALUES
(38, '220032', 'ABC Building Products Ltd.', 'info@abc-bpl.com', '22275588', '01777707347', '118636840763', '03-065661', '000314209-0403', '000314209-0403', 'www.bpl.abcgroup.com.bd', 'Nashid Islam', NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '2022-11-15 00:52:22', '2022-12-31 06:31:37', '<p></p>\r\n\r\n<ol>\r\n	<li>The delivery date may change as per direction of purchaser & consultant (if any). Also, and the seller will have to deliver the ready-mix concrete as per those direction</li>\r\n	<li>During supplying of ready-mix concrete, seller & purchaserjointly conduct slump test at construction site to measure the quality and mixing ratio. If the test fails, seller will return the whole truck of ready-mix concrete at their own cost</li>\r\n	<li><strong>Measurement Policy:</strong> If the construction area is 2000 Cft or More, sellermust take pre-measurement of the construction area jointly with purchaser. All measurement shall be preserved by both parties (duly sealedsSigned) If the casting area is filled by purchase order quantity, then post measurement is not required. However, if it takes more than the purchase order quantity to fill the casting area then post measurement will have to be conducted. If Post measurement value is more than 0.50% from purchase order quantity, then the purchaser and the sellerwill share the cost by 50% each party.</li>\r\n	<li>Batch Card report has to be provided with delivery challan with each delivery Truck.</li>\r\n	<li>During the supply of ready-mix concrete, site engineer & consultant (engaged by the purchaser) shall stay at seller\'s ready-mix plantto control and verify the ready-mix quality. Their signs must be taken at delivery prior challan dispatching any ready-mix delivery truck from ready-mix plant.</li>\r\n	<li>TDS (4.2%) will be realized from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to you in due course.</li>\r\n	<li>The purchaser has the right to cancel purchase order or any part of it, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 1, NULL),
(39, '220033', 'Energy+ Electric & Electronics Pvt. Ltd.', 'fmamirul@gmail.com', NULL, '01709373494', '710466248947', 'TRAD/DSCC/257380/2019', '001555119-0208', NULL, NULL, 'Mohammed Shah Jalal', '2812214191', NULL, NULL, '01711281173', NULL, 0, 0, 0, 0, '2022-11-15 01:09:03', '2023-01-03 05:50:28', '<ol><ol><li>The products must be supplied as per approved previous sample and specification. If the products do not match with the approved sample and specification, then the products will be returned by the seller at their own cost.&nbsp;</li><li>All Components of products (Lights) should have to be under two (2) years replacement warranty (if it is repairable, then it will be repaired by the seller) from the date of successful delivery.&nbsp;</li><li>VAT and TDS is included in the mentioned total price as per govt. rules.&nbsp;</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>The Original Delivery Challan (having seal-sign of concerned person/department) has to submit along with&nbsp;Warranty Card and a photocopy of purchase order with the final Unit-Wise Bill.&nbsp;</li><li>The purchaser has the right to cancel purchase order or any part of it, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.&nbsp;&nbsp;</li></ol></ol><ol>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 5, NULL),
(40, '220034', 'Hamid Enterprise', 'mr.hamidul2017@gmail.com', NULL, '01715136098', '126262929989', '3273', '001303598', NULL, NULL, 'Hamidul Islam', '5513982545', NULL, NULL, '01715136098', NULL, 0, 0, 0, 0, '2022-11-15 01:45:45', '2022-12-31 06:31:37', '<ol>\r\n	<li>The delivery date may change and the mentioned materials will be supplied part by part (if needed) as per direction of site engineer.&nbsp;</li>\r\n	<li>VAT and TDS is included in the mentioned total price as per govt. rules.&nbsp;</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li>\r\n	<li>Purchaser has the right to cancel purchase order or any part, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 1, NULL),
(41, '220035', 'H.M Electric', 'hmelectric8@gmail.com', NULL, '01902800450', 'NA', 'TRAD/DNCC/019326/2022', '004896249-0401', '004896249-0401', NULL, 'Md. Monirul Islam', '2812939540', NULL, NULL, '01902800450', NULL, 0, 0, 0, 0, '2022-11-15 02:23:16', '2022-12-31 06:31:37', '<ol>\r\n	<li>The supply has to be made as per approved sample and technical specification.&nbsp; If any deviation (mismatch of technical specs and damaged during transportation time) found with the supplied products, the seller will return all deviated products at their own cost.</li><li>Seller has to attach the Delivery Challan&nbsp;<span style=\"font-weight: bolder;\">(Having seal-sign of concerned person/department)&nbsp;</span>and photocopy of purchase order with the final&nbsp;<span style=\"font-weight: bolder;\">Unit-Wise</span>&nbsp;bill.&nbsp;</li><li>The purchaser has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 1, NULL),
(42, '220036', '_Crown Cement PLC.', 'info@crowncement.com', '02-2222636631', '00000000000', '731285933055', '2491', '000002741-0006', NULL, 'www.crowncement.com', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '2022-11-15 02:38:51', '2022-12-31 06:31:37', '<ol>\r\n	<li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited Challan will be given to you in due course.&nbsp;</li>\r\n	<li>MICFL Authority has to attach the original Delivery Challan <strong>(having seal-sign of concerned person/department)</strong> with the final bill.</li>\r\n	<li>CEIL Authority has the right to cancel Purchase order or any part of, if the Supplier fails to abide by the terms and conditions of the Purchase Order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Inactive', 'purchase-declined', 5, 1, NULL),
