(47, '220039', 'Akij Ceramics Ltd.', 'mishu.acrl@akijceramics.net', NULL, '01713998723', '726492171700', '502', '000162524-0104', '000162524-0104', 'www.akijceramics.net', 'Sheikh Bashir Uddin', '2691649104006', 'upload/supplier-owner-photo/2022/11/16/677161122055426.jpg', NULL, NULL, NULL, 0, 0, 0, 0, '2022-11-17 00:12:19', '2022-12-31 06:31:37', '<ol>\r\n	<li>Any damage &amp; broken products shall not be acceptable during delivery. </li><li>Delivery has to be made as per approved sample, size and specification. </li><li>Also, delivered all products shall have to be from same production shed. No shed variance shall be allowed/accepted for the delivery.&nbsp;</li><li>The delivered products shall be checked randomly by the engineers engaged by the purchaser during delivery. If any deviation found with the approved products, the seller shall return all products at their own cost.<br></li>\r\n	<li>Loading, carrying and unloading is included at the total mentioned price.</li><li>VAT and TDS is included in the mentioned total price.</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li>\r\n	<li>The seller has to attach the Original Delivery Challan <strong>(having seal &amp; sign of concerned person/department)</strong> and a photocopy of purchase order with the final bill.</li><li>The purchaser has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 1, NULL),
