(53, '220043', 'Imprest Engineering Limited', 'imprest.engineering@gmail.com', NULL, '01708802707', '266636549524', 'TRAD/DNCC/031743/2022', 'NA', 'NA', NULL, 'Md. Harisul Islam Chowdhury', '6855837594', 'upload/supplier-owner-photo/2022/11/16/771161122065056.jpeg', NULL, '01708802707', NULL, 0, 0, 0, 0, '2022-11-17 01:50:56', '2023-01-08 19:37:34', '<ol style=\"caret-color: rgb(0, 0, 0); text-size-adjust: auto;\"><li>The supply has to be made as per approved sample and technical specification.&nbsp; If any deviation (mismatch of technical specs and damaged during transportation time) found with the supplied products, the seller will return all deviated products at their own cost.</li><li>VAT and TDS is included in the mentioned total price.</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>The seller has to attach the Delivery Challan&nbsp;(Having seal-sign of concerned person/department)&nbsp;and photocopy of purchase order with the final&nbsp;Unit-Wise&nbsp;bill.&nbsp;</li><li>The purchaser has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li></ol>', 'yes', 'Active', 'management-approved', 5, 7, NULL),
(55, '220044', 'M/s. PK Survey Associates & Engineering', 'lalchanpk55@gmail.com', NULL, '01737629514', '248217402140', '04-34228', '001685568', '001685568', NULL, 'Md. Lalchan Pk.', '19918111244000243', 'upload/supplier-owner-photo/2022/11/20/120201122053639.jpg', NULL, '01737629514', NULL, 0, 0, 0, 0, '2022-11-21 00:36:39', '2023-02-08 19:09:14', '<ol>\r\n	<li>Service Provider has to submit the topographical survey report in AutoCAD format and 2 sets A2 size color hard copies to the Customer.</li>\r\n	<li>VAT &amp; Tax is included in the mentioned price as per Govt. rules.&nbsp;</li>\r\n	<li>Service Provider has to attach the original work completion report (having seal &amp; sign of concerned person/department) &amp; a photocopy of work order with the final bill.&nbsp;</li><li>The Customer has the right to cancel work order or any part of it, if the Service Provider fails to abide by the terms and conditions of the work order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 7, NULL),
