(79, '220065', 'Officina (BD) Ltd.', 'bangladesh@officina39.com', '028991200', NULL, '728528918232', '2096', '000128361-0403', '000128361-0403', 'www.officina39.com', 'Md Sohel Rana', 'N/A', NULL, NULL, '01815435020', NULL, 0, 0, 0, 0, '2022-11-28 03:11:43', '2023-01-01 22:35:55', '<div><ol><li>Transport cost will be borne by the seller.&nbsp;</li><li>VAT and TDS is included in the mentioned total price as per govt. rules.&nbsp;</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>If any&nbsp;issue arises related with quality, packaging and expiry, the seller&nbsp;will take care of the issues and change the materials at their own cost.&nbsp;</li><li><span style=\"font-variant-ligatures: normal; orphans: 2; widows: 2; text-decoration-thickness: initial;\">The seller has to attach the Delivery Challan&nbsp;</span><span style=\"font-variant-ligatures: normal; orphans: 2; widows: 2; text-decoration-thickness: initial;\">(Having seal-sign of concerned person/department)&nbsp;</span><span style=\"font-variant-ligatures: normal; orphans: 2; widows: 2; text-decoration-thickness: initial;\">and photocopy of purchase order with the final&nbsp;</span><span style=\"font-variant-ligatures: normal; orphans: 2; widows: 2; text-decoration-thickness: initial;\">Unit-Wise</span><span style=\"font-variant-ligatures: normal; orphans: 2; widows: 2; text-decoration-thickness: initial;\">&nbsp;bill.&nbsp;</span><br></li><li>The purchaser has the right to cancel purchase order or any part of, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li></ol></div>', 'yes', 'Active', 'management-approved', 5, 7, NULL),
(81, '220067', 'Crown Cement Concrete And Building Products Ltd.', 'rkd@crowncement.com', NULL, '01755646981', '898977157247', '143', '000777722-0403', '000777722-0403', 'www.crowncement.com', 'Md. Alamgir Kabir', '5925617129743', NULL, NULL, NULL, NULL, 0, 0, 0, 0, '2022-12-01 18:29:33', '2022-12-31 06:31:37', '<ol>\r\n	<li>The delivery date may change as per direction of purchaser & consultant (if any). Also, and the seller will have to deliver the ready-mix concrete as per those direction</li>\r\n	<li>During supplying of ready-mix concrete, seller & purchaserjointly conduct slump test at construction site to measure the quality and mixing ratio. If the test fails, seller will return the whole truck of ready-mix concrete at their own cost</li>\r\n	<li><strong>Measurement Policy:</strong>If the construction area is 2000 Cft or More, sellermust take pre-measurement of the construction area jointly with purchaser. All measurement shall be preserved by both parties (duly sealedsSigned) If the casting area is filled by purchase order quantity, then post measurement is not required. However, if it takes more than the purchase order quantity to fill the casting area then post measurement will have to be conducted. If Post measurement value is more than 0.50% from purchase order quantity, then the purchaser and the sellerwill share the cost by 50% each party.</li>\r\n	<li>Batch Card report has to be provided with delivery challan with each delivery Truck.</li>\r\n	<li>During the supply of ready-mix concrete, site engineer & consultant (engaged by the purchaser) shall stay at seller\'s ready-mix plantto control and verify the ready-mix quality. Their signs must be taken at delivery prior challan dispatching any ready-mix delivery truck from ready-mix plant.</li>\r\n	<li>TDS (3.0%) will be realized from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to you in due course.</li>\r\n	<li>The purchaser has the right to cancel purchase order or any part of it, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li>\r\n</ol>', 'yes', 'Active', 'management-approved', 5, 1, NULL),
