(99, '220083', 'DBL Ceramics Ltd.', 'mamunur.rashid@dbl-group.com', NULL, '01708151686', '426282629158', '2022-2023/87', '000389264-0103', '000389264-0103', NULL, 'M. A. Jabbar', NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '2022-12-11 22:38:26', '2023-02-07 21:42:45', '<ol style=\"caret-color: rgb(0, 0, 0); text-size-adjust: auto;\"><li>Any damage &amp; broken products shall not be acceptable during delivery.<span class=\"Apple-converted-space\">&nbsp;</span></li><li>Delivery has to be made as per approved sample, size and specification.<span class=\"Apple-converted-space\">&nbsp;</span>Also, all delivered products shall have to be from same production shed. No shed variance shall be allowed/accepted for the delivery.&nbsp;</li><li>The delivered products shall be checked randomly by the engineers engaged by the purchaser during delivery. If any deviation found with the approved products, the seller shall return all products at their own cost.<br></li><li>Loading, carrying and unloading is included at the total mentioned price.</li><li>VAT and TDS is included in the mentioned total price.</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>The seller has to attach the Original Delivery Challan<span class=\"Apple-converted-space\">&nbsp;</span>(having seal &amp; sign of concerned person/department)<span class=\"Apple-converted-space\">&nbsp;</span>and a photocopy of purchase order with the final bill.</li><li>The purchaser has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li></ol>', 'yes', 'Active', 'management-approved', 5, 7, NULL),
(100, '220084', 'RH Corporation', 'info@rhcorp.com', '09609006216', NULL, '722175214765', '017391', '000174316-0208', '000174316-0208', 'www.rhcorpbd.com', 'Rajibul Huq Chowdhury', '4174000721', NULL, NULL, '09609006215', NULL, 0, 0, 0, 0, '2022-12-13 17:03:20', '2023-02-07 22:37:30', '<ol style=\"caret-color: rgb(0, 0, 0); text-size-adjust: auto;\"><li>Transport cost will be borne by the seller.&nbsp;</li><li>VAT and TDS is included in the mentioned total price as per govt. rules.&nbsp;</li><li>TDS will be deducted from the complete purchase order value. The same will be deposited to the exchequer within three weeks of final payment made to you. The deposited challan will be given to the seller in due course.&nbsp;</li><li>If any&nbsp;issue arises related with quality, packaging and expiry, the seller&nbsp;will take care of the issues and change the materials at their own cost.&nbsp;</li><li>The seller has to attach the Delivery Challan&nbsp;(Having seal-sign of concerned person/department)&nbsp;and photocopy of purchase order with the final&nbsp;Unit-Wise&nbsp;bill.&nbsp;<br></li><li>The purchaser has the right to cancel purchase order or any part of, if the seller fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</li></ol>', 'yes', 'Active', 'management-approved', 5, 88, NULL),
